  render() {
    return (
      <View>
      <ul>
               {this.state.polls.map((poll) => (
                    <li key={poll.id}>{poll[0]}</li>
                ))}
      </ul>
        <Text>components</Text>
        <Umesh/>
        <Umesh/>
        <Umesh/>
        <Umesh/>
        <Umesh/>


      </View>
    )
  }
}


const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
